import React from 'react';
import {Link, Route} from 'react-router-dom';
import logo from "../images/CTVLogoCleanCopy.png";

const Navbar = () => {
    return (
    <header id="header">
        <div className="inner">
            <Link to="/" className="logo">
            <img src={logo} style={{width: 'auto', height: 50, display: 'block', marginLeft: 'auto', marginRight: 'auto'}} alt="Home" />
            </Link>
            <nav id="nav">
            <Link to="/">Home</Link>
            <Link to="/faq">FAQ</Link>
            <Route path='/privacy-policy' component={() => { 
     window.location.href = 'https://google.com'; 
     return null;
}}>Re</Route>
            <Link to="/about_us">About Us</Link>
            <Link to="/login">Log In/Register</Link>
            </nav>
            <Link to="#navPanel" className="navPanelToggle"><span className="fa fa-bars" /></Link>
        </div>
    </header>
      
    );
};

export default Navbar;
